css:
@-moz-document domain("relay.dev") {
body {
  background-color: #222;
  color: #ABD;
}
.lightBackground {
  background-color: #333;
}
.hljs {
  background-color: #333;
  color: #ABD;
}
.hljs-keyword {
  color: darkorange;
}
.hljs-section, .hljs-title {
  color: #EB0;
}
.hljs-string {
  color: #C88;
}
.hljs-built_in {
  color: darkgoldenrod;
}
.hljs-attr {
  color: mediumpurple;
}
code {
  background-color: #444;
  color: #BCE;
}
.fixedHeaderContainer, .navigationSlider .slidingNav ul {
  background-color: #A40
}
.navigationSlider .slidingNav ul li.siteNavGroupActive>a,
.navigationSlider .slidingNav ul li.siteNavItemActive>a {
  background-color: #444
}
.docsNavContainer {
  background-color: #444;
}
.docsNavContainer .toc .navBreadcrumb {
  background-color: #444;
}
.navGroups {
  background-color: #444;
}
.toc .toggleNav .navGroup .navGroupCategoryTitle {
  color: whitesmoke
}
.toc .toggleNav ul li.navListItemActive a {
  color: darkorange
}
.line1, .line2, .line3 {
  background-color: whitesmoke
}
.navItem {
  color: whitesmoke
}
.toc .toggleNav ul li a {
  color: whitesmoke
}
.navBreadcrumb span {
  color: whitesmoke
}
}
